  return (
    <div>
      <div className="about">
        <h3>SY MAKINA HAKKINDA</h3>
      </div>
      <h1>HAKKIMIZDA</h1>
      <ReactWhatsapp number="1-212-736-5000" message="Hello World!!!" />
    </div>
  );
}
